function gen(number) {
	var data = fulldata["第" + number + "案"];

	var width = 460,
		height = 600;

	var path = d3.geo.path()
		.projection(d3.geo
		.mercator()
		.scale(8000)
		.center([122.7, 24]));

	var svg = d3.select("body").select("svg")
		.attr("width", width)
		.attr("height", height)
		.append('g');

	var defs = svg.append("defs");

	defs.append("filter")
		.attr("id", "blur")
		.append("feGaussianBlur")
		.attr("stdDeviation", 5);

	var map = topojson.feature(county, county.objects.map);

	defs.append("path")
	.datum(map)
	.attr("id", "land")
	.attr("d", path);

	svg.append("use")
	.attr("class", "land-glow")
	.attr("xlink:href", "#land");

	svg.append("use")
	.attr("class", "land-fill")
	.attr("xlink:href", "#land");

	var region = svg.append("g").attr("class", "polygons");

	region.selectAll(".region").data(map.features)
	.enter().insert("path")
	.attr("class", "region")
	.attr("d", path)
	.style("fill", function(d, i) {
		percent = data[d.properties.name].EffectiveVotingRights;
		return getColorForPercentage(percent);
	});

	var labelsBg = svg.append("g").attr("class", "label-group-bg");
	labelsBg.selectAll(".label-bg")
	.data(map.features)
	.enter()
	.append("text")
	.attr("class", "label-bg")
	.attr("x", function(d) {
		return path.centroid(d)[0];
	})
	.attr("y", function(d) {
		return path.centroid(d)[1];
	})
	.text(function(d) {
		percent = data[d.properties.name].EffectiveVotingRights;
		return d.properties.name + " (" + percent + "%)";
	});

	var labels = svg.append("g").attr("class", "label-group");
	labels.selectAll(".label")
	.data(map.features)
	.enter()
	.append("text")
	.attr("class", "label")
	.attr("x", function(d) {
		return path.centroid(d)[0];
	})
	.attr("y", function(d) {
		return path.centroid(d)[1];
	})
	.text(function(d) {
		percent = data[d.properties.name].EffectiveVotingRights;
		return d.properties.name + " (" + percent + "%)";
	});
}

var percentColors = [
	{ pct: 10, color: { r: 0x80, g: 0, b: 0 } },
	{ pct: 15, color: { r: 0xff, g: 0, b: 0 } },
	{ pct: 20, color: { r: 0xff, g: 0x80, b: 0x80 } },

	{ pct: 25, color: { r: 0xa0, g: 0xa0, b: 0xa0 } },

	{ pct: 30, color: { r: 0x80, g: 0xff, b: 0x80 } },
	{ pct: 35, color: { r: 0, g: 0xff, b: 0 } },
	{ pct: 40, color: { r: 0, g: 0x80, b: 0 } }
];

var getColorForPercentage = function(pct) {
	for (var i = 1; i < percentColors.length - 1; i++) {
		if (pct < percentColors[i].pct)
			break;
	}

	var lower = percentColors[i - 1];
	var upper = percentColors[i];
	var range = upper.pct - lower.pct;
	var rangePct = (pct - lower.pct) / range;
	var pctLower = 1 - rangePct;
	var pctUpper = rangePct;

	var color = {
		r: Math.floor(lower.color.r * pctLower + upper.color.r * pctUpper),
		g: Math.floor(lower.color.g * pctLower + upper.color.g * pctUpper),
		b: Math.floor(lower.color.b * pctLower + upper.color.b * pctUpper)
	};

	return 'rgb(' + [color.r, color.g, color.b].join(',') + ')';
}
